import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {

    const closeHiddenMenu = (event) => {
        event.target.parentElement.style.left = "-60%";
    }

    return (
        <nav class="navbar navbar-expand navbar-dark bg-secondary px-2">
            <a class="navbar-brand" href="https://www.google.com" target="_blank" rel="noreferrer">Redux</a>
            <ul class="navbar-nav ms-3">
                <li><a class="nav-link"><Link to="/shop">Shop</Link></a></li>
                <li><a class="nav-link"><Link to="/users">Users</Link></a></li>
            </ul>
        </nav>
    );
}

export default Navbar;
